export default (function(a,b,c,d){return {data:{p3LFZMtqik:{data:{id:830,attributes:{imdbId:"tt0031225",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjlhOTRlMTctMmNkYy00NDFiLTg5NzItZjcyMTA5ZDYyMDBlXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.7\u002F10"},{Source:"Rotten Tomatoes",Value:"96%"},{Source:"Metacritic",Value:"81\u002F100"}],item_lang:{data:{id:1493,attributes:{title:b,plot:"Kent, the unscrupulous boss of Bottleneck has Sheriff Keogh killed when he asks one too many questions about a rigged poker game that gives Kent a stranglehold over the local cattle rangers. The mayor, who is in cahoots with Kent appoints the town drunk, Washington Dimsdale, as the new sheriff assuming that he'll be easy to control. But what the mayor doesn't know is that Dimsdale was a deputy under famous lawman, Tom Destry, and is able to call upon the equally formidable Tom Destry Jr to be his deputy. Featuring a career reviving performance from Marlene Dietrich as bar singer Frenchie, which could well have been the inspiration for Madeline Kahn's \"Blazing Saddles\" character, Lili Von Schtupp.",slug:"destry-rides-again"}}},books:{data:[{id:5141,attributes:{title:b,description:a,thumbnail:a,authors:["Frederick Schiller Faust"],firstBook:true,published:"2017-01-01",publisher:a,subtitle:a}},{id:5142,attributes:{title:b,description:"After serving a six year prison term because of the betrayal of a friend, Harrison Destry decides to hunt down the twelve jurors who convicted him",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=p60H6mqk6oAC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"1987-01-01",publisher:a,subtitle:a}},{id:5143,attributes:{title:b,description:a,thumbnail:a,authors:[c],firstBook:d,published:"1950-01-01",publisher:a,subtitle:c}},{id:5144,attributes:{title:b,description:"This fast-paced story is about a tough rebel named Destry who is sent to prison for years, serving time for a crime he did not commit. Once out, he aims to seek revenge on the 12 jury members who sent him to prison. However, his mission isn't to kill but to find other unique ways as punishment... “No pulp writer was more prolific than Frederick Faust, who wrote nearly 15 million words under the pen name of Max Brand and seventeen others. He sold all his stories and sometimes wrote complete issues of Western Story Magazine.” -- The Incredible Pulps",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=AIVeDwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c,"Frederick Faust"],firstBook:d,published:"2018-05-31",publisher:"Wildside Press LLC",subtitle:a}},{id:5145,attributes:{title:"Max Brands Fiction Rodeo",description:a,thumbnail:a,authors:[c],firstBook:d,published:"1931-01-01",publisher:a,subtitle:"Containing Two Complete Novels: Smiling Charlie ; Destry Rides Again"}}]}}},meta:{}}},prerenderedAt:1680940956316}}("","Destry Rides Again","Max Brand",null))